INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (20981, '            <p> Чай — напиток, получаемый варкой, завариванием или настаиванием чайного листа. Чайный лист предварительно подготавливается специальным образом. </p>          <p> Чай в первую очередь содержит витамины Р, РР, С и группы В. Точное содержание определяется способом подготовки и сортом чая. </p>            <p> В нашем интернет-магазине вы можете купить чай различных сортов и марок. </p>', '/_sh/209/20981c.jpg', 2, 'Чай', 20980, 117, '//minutka-nn.ru/shop/napitki/chaj') ON CONFLICT (id) DO NOTHING;
INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (7862, '', '/_sh/78/7862c.jpg', 3, 'Чёрный чай', 20981, 76, '//minutka-nn.ru/shop/napitki/chaj/chjornyj-chaj') ON CONFLICT (id) DO NOTHING;
