INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (20982, '              <p> Кофе — древнейший напиток из жареных и перемолотых зёрен кофейного дерева. Умеренное потребление кофе продлевает жизнь, тонизирует, а также кратковременно улучшает внимание и способность концентрироваться. </p>              <p> Ниже представлены различные наименования кофе от известных брендов, которые вы можете купить в нашем интернет-магазине.</p>', '/_sh/209/20982c.jpg', 2, 'Кофе', 20980, 144, '//minutka-nn.ru/shop/napitki/kofe') ON CONFLICT (id) DO NOTHING;
INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (20890, '', '/_sh/208/20890c.jpg', 3, 'Быстрорастворимый кофе', 20982, 77, '//minutka-nn.ru/shop/napitki/kofe/bystrorastvorimyj-kofe') ON CONFLICT (id) DO NOTHING;
INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (20891, '                <p> Молотый кофе готов к употреблению и не требует помола. </p>                <p> Ниже представлены различные марки молотого кофе от известных брендов, которые вы можете купить в нашем интернет-магазине. </p>', '/_sh/208/20891c.jpg', 3, 'Молотый кофе', 20982, 17, '//minutka-nn.ru/shop/napitki/kofe/molotyj-kofe') ON CONFLICT (id) DO NOTHING;
INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (7867, '                  <p> Зёрна измельчают в зависимости от того, каким способом будут готовить кофе. Грубый помол используется во френч-прессе, средний — для фильтр-кофе, мелкий и самый мелкий — для кофе эспрессо и «по-восточному» (в турке). </p>                  <p> Молотый кофе быстро теряет вкусовые и ароматические качества и аромата, поэтому молоть зёрна нужно непосредственно перед приготовлением. </p>                  <p> Ниже представлены различные марки кофе в зернах от известных брендов, которые вы можете купить в нашем интернет-магазине. </p>', '/_sh/78/7867c.jpg', 3, 'Кофе в зёрнах', 20982, 30, '//minutka-nn.ru/shop/napitki/kofe/kofe-v-zjornakh') ON CONFLICT (id) DO NOTHING;
