INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (7908, '                    <p>Производится в разных видах: крупного и мелкого помола, чистая, йодированная, нитритная и так далее. В зависимости от чистоты делится на сорта: экстра, высший, первый и второй. </p>                    <p> Энергетическая ценность: 0 ккал. на 100 гр.</p>                    <p> Ниже представлены различные наименования соли от известных производителей, которые вы можете купить в нашем магазине.</p>', '/_sh/79/7908c.jpg', 3, 'Соль', 20986, 17, '//minutka-nn.ru/shop/bakaleja/specii-pripravy-sousy/sol') ON CONFLICT (id) DO NOTHING;
