INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (20906, '                      <p> Оливковое масло получают из плодов оливы европейской. Имеет высокое содержание эфиров олеиновой кислоты. Цвет от буровато-желтого до зеленовато-желтого и привкус легкой горчинки. </p>                      <p> Энергетическая ценность: 883 ккал. на 100 гр. </p>                      <p> Ниже представлены различные наименования оливкового масла от известных брендов, которые вы можете купить в нашем магазине. </p>', '/_sh/209/20906c.jpg', 3, 'Оливковое масло', 20987, 23, '//minutka-nn.ru/shop/bakaleja/masla-rastitelnye/olivkovoe-maslo') ON CONFLICT (id) DO NOTHING;
