INSERT INTO ucoz_categories_snapshot (id, descr, cat_img_url, cat_level, forename, parent_id, num_entries, url) VALUES (20993, '                        <p> Мыло — твёрдый или жидкий продукт, используемый для очищения кожи и ухода за ней (туалетное мыло), либо как средство бытовой химии — в качестве моющего средства (хозяйственное мыло). </p>                        <p> Основными составляющими мыла являются растворимые соли жирных кислот, например стеарат натрия. Подробности читайте на упаковке. </p>                        <p>Ниже представлены различные марки мыла от известных брендов, которые вы можете купить в нашем интернет-магазине. </p>', '/_sh/209/20993c.jpg', 2, 'Мыло', 20991, 49, '//minutka-nn.ru/shop/gigiena-i-kosmetika/mylo') ON CONFLICT (id) DO NOTHING;
